import React from "react";

const mainText = [
  { text: "we provide" },
  { text: "visual coding" },
  { text: "solutions" },
  { text: "for you webs" },
];

function MainCont() {
  return (
    <section className="main__cont">
      <div className="main__inner">
        <div>we provide</div>
        <div>visual coding</div>
        <div>solutions</div>
        <div>for you webs</div>
      </div>
    </section>
  );
}

export default MainCont;
